import { loginUser } from "./../lib/auth";

class LogninForm extends React.Component {
  state = {
    email: "",
    password: "",
  };

  handleChange = (event) => {
    this.setState({ [ecent.target.name]: event.target.value });
  };

  handleSubmit = (event) => {
    event.preventDefault();
    loginUser();
  };

  render() {
    return (
      <form onSubmit={this.handleSubmit}>
        <div>
          <input
            type="email"
            name="email"
            placeholder="email"
            onChange={this.handleChange}
          ></input>
        </div>
        <div>
          <input
            type="password"
            name="password"
            placeholder="password"
            onChange={this.handleChange}
          ></input>
          <button type="submit">Submit</button>
        </div>
      </form>
    );
  }
}

export default LogninForm;
